    def __init__(self, n, mod):
        self.g1 = [1, 1]
        self.g2 = [1, 1]
        self.re = [0, 1]
        self.md = mod
        for i in range(2, n + 1):
            self.g1.append((self.g1[-1] * i) % self.md)
    def fact(self, n):
        return self.g1[n]
    def perm(self, n, k):
        return (self.g1[n] * self.g2[n - k]) % self.md
    def comb(n, k):
        if k < 0 or k > n:
            return 0
        k = min(k, n - k)
        return self.g1[n] * self.g2[k] * self.g2[n - k] % self.md
    def homo(n, k):
        return self.comb(n + k - 1, k)

