class UnionFind:
    def __init__(self, n):
        self.root = [i for i in range(n + 1)]
        self.size = [1] * (n + 1)
        self.nn = n
    def find(self, x):
        y = self.root[x]
        if x == y:
            return x
        else:
            z = self.find(y)
            self.root[x] = z
            return z
    def union(self, x, y):
        rx = self.find(x)
        ry = self.find(y)
        sx = self.size[rx]
        sy = self.size[ry]
        if rx == ry:
            return 0
        else:
            if sx >= sy:
                self.root[ry] = rx
                self.size[rx] = sx + sy
            else:
                self.root[rx] = ry
                self.size[ry] = sx + sy
        return sx * sy
    def size_list(self, n):
        ret = []
        cnt = [0] * (n + 1)
        for i in range(1, n + 1):
            if cnt[self.find(i)] == 0:
                cnt[self.find(i)] = 1
                ret.append(self.size[self.find(i)])
        return ret
    def check(self):
        print([self.find(i) for i in range(1, self.nn + 1)])

